import React, { useState } from "react";
import { Link } from "react-router-dom";
import axios from "axios";

import { useNavigate } from "react-router-dom";

const CreateTravel = (props) => {
  // Define the state with useState hook
  const navigate = useNavigate();
  const [travel, setTravel] = useState({
    title: "",
    isbn: "",
    img: "",
    author: "",
    description: "",
    published_date: "",
    publisher: "",
  });

  const onChange = (e) => {
    setTravel({ ...travel, [e.target.name]: e.target.value });
  };

  const token = window.localStorage.getItem("token");
  const onSubmit = (e) => {
    e.preventDefault();
    axios
      .post("http://localhost:5000/api/v1/books", travel, {
        headers: { Authorization: `Bearer ${token}` },
      })
      .then((res) => {
        setTravel({
          title: "",
          isbn: "",
          img: "",
          author: "",
          description: "",
          published_date: "",
          publisher: "",
        });
        // Push to /
        navigate("/");
      })
      .catch((err) => {
        console.log("Error in CreateBook!");
      });
  };

  return (
    <div className="CreateBook">
      <div className="container">
        <div className="row">
          <div className="col-md-8 m-auto">
            <br />
            <Link to="/" className="btn btn-outline-warning float-left">
              Show Travel List
            </Link>
          </div>
          <div className="col-md-8 m-auto">
            <h1 className="display-4 text-center">Add Travel</h1>
            <p className="lead text-center">Create new travel</p>

            <form noValidate onSubmit={onSubmit}>
              <div className="form-group">
                <input
                  type="text"
                  placeholder="Title of the Travel"
                  name="title"
                  className="form-control"
                  value={travel.title}
                  onChange={onChange}
                />
              </div>
              <br />

              <div className="form-group">
                <input
                  type="text"
                  placeholder="ISBN"
                  name="isbn"
                  className="form-control"
                  value={travel.isbn}
                  onChange={onChange}
                />
              </div>

              <div className="form-group">
                <input
                  type="text"
                  placeholder="img"
                  name="img"
                  className="form-control"
                  value={travel.img}
                  onChange={onChange}
                />
              </div>

              {/* <div className="form-group">
                <input type="file" />
              </div> */}
              {/* <div className="form-group">
                <button className="btn btn-primary" type="submit">
                  Upload
                </button>
              </div> */}

              <div className="form-group">
                <input
                  type="text"
                  placeholder="Author"
                  name="author"
                  className="form-control"
                  value={travel.author}
                  onChange={onChange}
                />
              </div>

              <div className="form-group">
                <input
                  type="text"
                  placeholder="Describe this travel"
                  name="description"
                  className="form-control"
                  value={travel.description}
                  onChange={onChange}
                />
              </div>

              <div className="form-group">
                <input
                  type="date"
                  placeholder="published_date"
                  name="published_date"
                  className="form-control"
                  value={travel.published_date}
                  onChange={onChange}
                />
              </div>
              <div className="form-group">
                <input
                  type="text"
                  placeholder="Publisher of this Travel"
                  name="publisher"
                  className="form-control"
                  value={travel.publisher}
                  onChange={onChange}
                />
              </div>

              <input
                type="submit"
                className="btn btn-outline-warning btn-block mt-4"
              />
            </form>
          </div>
        </div>
      </div>
    </div>
  );
};

export default CreateTravel;
